import 'bootstrap/dist/css/bootstrap.min.css';
import { NavigateFunction, useNavigate } from "react-router-dom";
import Cookies from 'js-cookie';
import axios from "axios";
import { useState,useEffect } from 'react';
import { toast } from 'react-hot-toast'
import "bootstrap-icons/font/bootstrap-icons.css";
import '../styles/cart.css'
import { Itemdata, Userint,Cartdata} from '../interfaces/commonInt';

function Cart() {
  const [cartdata,setCartdata] = useState<Array<Cartdata>>([]);
  const Navigate:NavigateFunction = useNavigate();
  const cookie = document.cookie;
  const fetchcart =async () =>{
    const fetchdetailcart = await axios.get('http://localhost:5050/fetchcart', { withCredentials: true });
   setCartdata(fetchdetailcart.data.cartdetail)
  }
  useEffect(() => {
    fetchcart();
  },[]);
  if (!cookie) {
    return(
      <>
        <h1>Access Denied</h1>
      </>
    )
  }
  else{
    {console.log(cartdata)}
    return (
      <>
        {cartdata.map((obj) =>{
         return(
          <section className='card cart'>
          <div className='card-wrap'>
            <nav className="navbar navbar-expand-md navbar-dark navbar">
              <div className="container">
                <div className="navbar-brand m-auto">Simple Ecommerce</div>
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarsExampleDefault" aria-controls="navbarsExampleDefault" aria-expanded="false" aria-label="Toggle navigation">
                  <span className="navbar-toggler-icon"></span>
                </button>
              </div>
            </nav>
            <section className="jumbotron text-center">
              <div className="container">
                <h1 className="jumbotron-heading">E-COMMERCE CART</h1>
              </div>
            </section>

            <div className="container mb-4">
              <div className="row">
                <div className="col-12">
                  <div className="table-responsive">
                    <table className="table table-striped">
                      <thead>
                        <tr>
                          <th scope="col"> </th>
                          <th scope="col">Product</th>
                          <th scope="col">Available</th>
                          {/* <th scope="col" className="text-center">Quantity</th> */}
                          <th scope="col" className="text-right">Price</th>
                          <th> </th>
                        </tr>
                      </thead>
                      <tbody>
                        <tr>
                          <td><img src="https://dummyimage.com/50x50/55595c/fff" /> </td>
                          <td>Product Name Dada</td>
                          <td>In stock</td>
                          {/* <td><input className="form-control" type="text" value="1" /></td> */}
                          <td className="text-right">124,90 €</td>
                          <td className="text-right"><button className="btn btn-sm btn-danger"><i className="bi bi-trash3"></i> </button> </td>
                        </tr>
                        <tr>
                          <td><img src="https://dummyimage.com/50x50/55595c/fff" /> </td>
                          <td>Product Name Toto</td>
                          <td>In stock</td>
                          {/* <td><input className="form-control" type="text" value="1" /></td> */}
                          <td className="text-right">33,90 €</td>
                          <td className="text-right"><button className="btn btn-sm btn-danger"><i className="bi bi-trash3"></i> </button> </td>
                        </tr>
                        <tr>
                          <td><img src="https://dummyimage.com/50x50/55595c/fff"/> </td>
                          <td>Product Name Titi</td>
                          <td>In stock</td>
                          {/* <td><input className="form-control" type="text" value="1" /></td> */}
                          <td className="text-right">70,00 €</td>
                          <td className="text-right"><button className="btn btn-sm btn-danger"><i className="bi bi-trash3"></i> </button> </td>
                        </tr>
                        <tr>
                          <td></td>
                          <td></td>
                          <td></td>
                          {/* <td></td> */}
                          <td>Sub-Total</td>
                          <td className="text-right">255,90 €</td>
                        </tr>
                        <tr>
                          <td></td>
                          <td></td>
                          <td></td>
                          {/* <td></td> */}
                          <td>Shipping</td>
                          <td className="text-right">6,90 €</td>
                        </tr>
                        <tr>
                          <td></td>
                          <td></td>
                          <td></td>
                          {/* <td></td> */}
                          <td><strong>Total</strong></td>
                          <td className="text-right"><strong>346,90 €</strong></td>
                        </tr>
                      </tbody>
                    </table>
                  </div>
                </div>
                <div className="col mb-2">
                  <div className="row">
                    <div className="text-center">
                      <button className="btn btn-lg btn-block btn-success text-uppercase">Checkout</button>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </section>
         )
         })} 
      </>
    );
  }
}

export default Cart;
